ControlPropertyState.AutoRuleBindingString:
Set(
    SpinnerCounter,
    SpinnerCounter + 1
);
With(
    {
        Result: ForAll(
            Distinct(
                dlist_produtosParaCompra.SelectedItems,
                new_produtoservicoid
            ),
            {Result: ThisRecord.Value}
        )
    } As ProdIds,
    With(
        {
            Result: Filter(
                'Produtos-Serviço' As P,
                P.'Produto-Serviço' in ProdIds.Result && IsBlank(P.Cotação)
            )
        } As ProdServs,
        If(
            CountRows(ProdServs.Result) > 0,
            With(
                {
                    Result: Patch(
                        Cotações,
                        Defaults(Cotações)
                    ).Cotação
                } As NovaCotacaoId,
                If(
                    !IsBlank(NovaCotacaoId),
                    With(
                        {
                            NovaCotacao: LookUp(
                                Cotações,
                                Cotação = NovaCotacaoId.Result
                            ),
                            Fornecedor: LookUp(
                                'Fornecedores From Sharepoint Lists',
                                'Fornecedores From Sharepoint List' = First(
                                    Filter(
                                        SelectedFornecedor.Produtos As P,
                                        !IsBlank(P.'Fornecedor Menor Custo Id')
                                    )
                                ).'Fornecedor Menor Custo Id'
                            )
                        } As Results,
                        Relate(
                            Results.Fornecedor.Cotações,
                            Results.NovaCotacao
                        );
                        ForAll(
                            ProdServs.Result As ProdServ,
                            Relate(
                                Results.NovaCotacao.'Produtos-Serviço',
                                ProdServ
                            )
                        );
                        Navigate(
                            Patch(
                                Cotações,
                                Results.NovaCotacao,
                                {
                                    'Valor Total': With(
                                        {
                                            Result: Filter(
                                                'Produtos-Serviço',
                                                Cotação.Cotação = NovaCotacaoId.Result
                                            )
                                        } As ProdServRelacionados,
                                        Sum(
                                            ProdServRelacionados.Result As Cur,
                                            Cur.Quantidade * LookUp(
                                                'Preços de Produtos',
                                                Status = 'Status (Preços de Produtos)'.Active && 'Modelo de Produto'.'Modelos de Produto From Sharepoint List' = Cur.Produto.'Modelos de Produto From Sharepoint List'
                                            ).'Preço de Compra'
                                        )
                                    )
                                }
                            )
                        )
                    )
                )
            )
        )
    )
);
Select(btn_refresh);
Set(
    SpinnerCounter,
    SpinnerCounter - 1
)

Table(
    {
        ItemKey: "Fechar",
        ItemIconName: "Cancel",
        ItemDisplayName: "Fechar",
        ItemVisible: And(
            CountRows(ProdutosTable.SelectedItems) > 0,
            ProdutosTable.Visible
        )
    },
    {
        ItemKey: "Iniciar Cotação",
        ItemIconName: "ShoppingCart",
        ItemDisplayName: "Iniciar Cotação",
        ItemVisible: And(
            CountRows(ProdutosTable.SelectedItems) > 0,
            ProdutosTable.Visible
        )
    }
)

"Valor Total: "&With(
                {
                    Result: ForAll(Distinct(
                        dlist_produtosParaCompra.SelectedItems As X,
                        X.new_produtoservicoid
                    ), {Result: ThisRecord.Value})
                } As SelecaoIds,
                With(
                    {
                        Result: Filter(
                            'Produtos-Serviço',
                            'Produto-Serviço' in SelecaoIds.Result
                        )
                    } As Selecao,
                    Text(
                        Sum(
                            Selecao.Result As Prod,
                            LookUp(
                                'Preços de Produtos' As Prec,
                                Prec.'Modelo de Produto'.'Modelos de Produto From Sharepoint List' = Prod.Produto.'Modelos de Produto From Sharepoint List'
                            ).'Preço de Compra' * Prod.Quantidade
                        ),
                        "[$-pt-BR]R$#.##0,00"
                    )
                )
            )
